İşte x.com için genel bir web scraper script'i. Bu script, ana sayfaya gider, ana başlık 'X' ve temel navigasyon linklerinin URL'lerini toplayacak şekilde tasarlanmıştır. 

```typescript
import { test, expect } from '@playwright/test';

test('X.com Homepage Scraper', async ({ page }) => {
  // Website'ye git
  await page.goto('https://x.com');

  // Ana başlık 'X''i bul
  const mainTitle = await page.locator('heading:has-text("X")').innerText();

  // Navigasyon linkleri
  const navLinks = await page.locator('nav "Primary" >> a');

  const links = [];
  for (let i = 0; i < await navLinks.count(); i++) {
    const link = navLinks.nth(i);
    const url = await link.getAttribute('href');
    links.push(url);
  }

  console.log('Main Title:', mainTitle);
  console.log('Navigation URLs:', links);
});
```

Bu temel script ile ana sayfadaki başlık ve ana navigasyon linklerini çekebilirsiniz. Daha detaylı veri toplamak veya belirli elementleri hedeflemek için script'i expand edebilirsiniz.
